import firebase from 'firebase/app';
import 'firebase/auth';
import 'firebase/storage';
import 'firebase/firestore';

try {
  firebase.initializeApp({
    apiKey: 'AIzaSyAM4jc29ZUGAR8G4lzTcgVxLmMIYMOdzA0',
    authDomain: 'conversation-f167e.firebaseapp.com',
    projectId: 'conversation-f167e',
    storageBucket: 'conversation-f167e.appspot.com',
    messagingSenderId: '1012754952890',
    appId: '1:1012754952890:web:f35bedf3debccc955a0883',
  });
} catch (error) {
  if (!/already exists/u.test(error.message)) {
    console.error('Firebase admin initialization error', error.stack);
  }
}

export const fb = {
  auth: firebase.auth(),
  storage: firebase.storage(),
  firestore: firebase.firestore(),
};
